    "2013-03-14T19:22:23.265781",nt"name": "dudleya-variegata-translocation-san-diego-ds654",nt"isopen":
    false,nt"url": null,nt"notes": "At Mission Trails Regional Park, a translocation
    project of Dudleya variegata was conducted in efforts to save the population from
    a private property undergoing development. Approximately 2860 Dudleya variegata
    (CNPS 1B) plants were translocated from a private property to Mission Trails as
    part of a CEQA mitigation requirement (The Trails project, LDR 95-0695). After the
    translocation, the population was monitored for 5 years to determine success. Biologists
    from RECON monitored the site in 2007 and recorded the number of plants observed
    at sites where the plants had been translocated. The number of plants found at each
    site and the GPS accuracy was recorded (Sean Bohac, RECON, pers. comm.). This dataset
    was compiled as part of the Southern California Data Integration Project. References
    Sean Bohac. 2009. RECON Environmental. Personal communication, 2009.",nt"license_title":
